import React, { useEffect, useState } from "react";
import OrganizationChart from "@dabeng/react-orgchart";
import { Row, Col, Card } from 'react-bootstrap';
import HtmlHead from 'components/html-head/HtmlHead';
import BreadcrumbList from 'components/breadcrumb-list/BreadcrumbList';
import useCustomLayout from 'hooks/useCustomLayout';
import { MENU_PLACEMENT, LAYOUT } from 'constants.js';
import { toast } from 'react-toastify';
import { useSelector } from 'react-redux';
import { Signup } from '../services/signin';
import MyNode from "../components/node/mynode";
import { TreeView } from '../services/treeservice';


let handleClick = null;

const TreeViewDabeng = () => {

    const { currentUser, isLogin } = useSelector((state) => state.auth);
    const [goals, getGoals] = useState('');
    const [isLoading, setLoading] = useState(true);

    // let ds = {
    //   id: "n1",
    //   name: "Mr. Jonathan",
    //   title: "general manager",
    //   children: [
    //     { id: "n2", name: "Ms. Perera", title: "department manager" },
    //     {
    //       id: "n3",
    //       name: "Ms. Juli",
    //       title: "department manager"
    //     },
    //     { id: "n9", name: "Ms. Percy", title: "department manager" },
    //     {
    //       id: "n10",
    //       name: "Mr. Markes",
    //       title: "department manager",
    //       children: [{ id: "n11", name: "Mr. Markes", title: "senior engineer" }]
    //     }
    //   ]
    // };
    let ds = null;

    const getAllGoals = () => {

      let result = null;
      const Signups  =  TreeView(currentUser.token).then(function(response) {
        if(response) {
          if(response.responseCode === 200) {
            toast.success(response.responseDesc, {
              position: "top-right",
              autoClose: 5000,
              hideProgressBar: false,
              closeOnClick: true,
              pauseOnHover: true,
              draggable: true,
              progress: undefined,
            });
            // console.log(response.responseData);
            result = response.responseData;
            getGoals(result);
          }else{  
            toast.error(response.responseDesc, {
              position: "top-right",
              autoClose: 5000,
              hideProgressBar: false,
              closeOnClick: true,
              pauseOnHover: true,
              draggable: true,
              progress: undefined,
            });
          }
        }
      }).then(() => {
        ds = result;
        console.log(ds);
      });
    }

    useEffect(() => {
      getAllGoals();
    }, []);


    handleClick = async () => {
      // console.log('submit form', values);
      let result = null;
      const Signups  =  TreeView(currentUser.token).then(function(response) {
        if(response) {
          if(response.responseCode === 200) {
            toast.success(response.responseDesc, {
              position: "top-right",
              autoClose: 5000,
              hideProgressBar: false,
              closeOnClick: true,
              pauseOnHover: true,
              draggable: true,
              progress: undefined,
            });
            result = response.responseData;
            console.log(ds);
          }else{  
            toast.error(response.responseDesc, {
              position: "top-right",
              autoClose: 5000,
              hideProgressBar: false,
              closeOnClick: true,
              pauseOnHover: true,
              draggable: true,
              progress: undefined,
            });
          }
        }
      }).then(() => { ds = result; });
    }


    const title = 'Tree Admin Page';
    const description = 'An page for configure the tree view.';

    const breadcrumbs = [{ to: '', text: 'Home' }];

    return (

        <div className="App2">

            <HtmlHead title={title} description={description} />
            <Row>
                <Col>
                    {/* Title Start */}
                    <section className="scroll-section" id="title">
                    <div className="page-title-container">
                        <h1 className="mb-0 pb-0 display-4">{title}</h1>
                        <BreadcrumbList items={breadcrumbs} />
                    </div>
                    {/* <Card className="mb-5" body>
                        <Card.Text>{description}</Card.Text> */}
                        <div className="EmptyDiv"> </div>
                        <OrganizationChart
                            datasource={ds}
                            chartClass="myChart"
                            NodeTemplate={MyNode}
                        />
                        {/* </Card> */}
                    </section>
                {/* Title End */}
                <button type="button" onClick={handleClick}>
                    Click Me
                </button>
                </Col>
            </Row>
        </div>

    );
};

  export default TreeViewDabeng;
